INSERT INTO `posts` (`id`, `created_at`, `updated_at`, `deleted_at`, `post_author`, `post_title`, `post_excerpt`, `post_content`, `post_content_filtered`, `post_parent`, `post_type`, `post_status`, `post_name`, `post_password`, `menu_order`, `post_mime_type`, `comment_status`, `comment_count`, `post_img`) VALUES
(7, '2023-04-01 17:34:38.032', '2023-04-01 17:34:38.035', NULL, 1, '梵蒂冈地方', '，是中国人创办的第一所国立大学医学院，颜福庆出任首任院长。1932年，独立为国立上海医学院。院训是“正谊明道”，出自《汉书·董仲舒传》：正其谊不谋其利，明其道不计其功。1939年，因抗战爆发内迁至云南昆明。1940年，辗转迁至四川重庆。1946年，抗战胜利，迁回上海', '<p>鬼地方鬼地方鬼地方</p>', '', 0, 'post', 'publish', '', '', 0, '', 'open', 0, 'uploads/file/b1d8fcdf6d0db7011c71fc30e7aef4a4_20230401145250.png'),
(8, '2023-04-01 17:35:05.831', '2023-04-01 17:35:05.836', NULL, 1, '广泛大锅饭', '1952年，更名为上海第一医学院。1959年，被定为全国16所重点高等学府之一。1985年，更名为上海医科大学。2000年，上海医科大学和复旦大学合并办学，组建成为新的复旦大学。2012年，新的上海医学院成立，作为复旦大学党政的派出机构，根据学校的授权，在大医口的人才培养、科学研究、学科建设、发展规划、资源配置、对外交流等方面，行使相对独立的管理权限。2017年，中共复旦大学上海医学院工作委员会成立，', '<p>高浮雕高浮雕鬼地方</p>', '', 0, 'post', 'publish', '', '', 0, '', 'open', 0, ''),
(9, '2023-04-01 17:42:15.191', '2023-04-01 18:59:58.541', NULL, 1, '《复旦大学上海医学院》简介', '复旦大学上海医学院简介', '<div class="_3ygOc lg-fl " style="max-width: 100%; overflow-x: visible; font-size: 18px; line-height: 30px; color: #222222; margin-top: 24px; font-family: arial; background-color: #ffffff;">\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 1.75; font-size: 14px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: center;"><img style="border: 0px; vertical-align: top; max-width: 100%; float: none;" src="https://shmc.fudan.edu.cn/_upload/article/images/3c/50/c5ea3a0843ba82fb139dd09dd087/7d207bb7-03db-4081-862e-1f19b43ad022.png" data-layer="photo" /></p>\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 35px; text-indent: 2em; font-size: 16px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: justify;">复旦大学上海医学院（简称&ldquo;复旦上医&rdquo;）地处上海市徐汇区，创建于1927年，创立时名为国立第四中山大学医学院，是中国人创办的第一所国立大学医学院，颜福庆出任首任院长。1932年，独立为国立上海医学院。院训是&ldquo;正谊明道&rdquo;，出自《汉书&middot;董仲舒传》：正其谊不谋其利，明其道不计其功。1939年，因抗战爆发内迁至云南昆明。1940年，辗转迁至四川重庆。1946年，抗战胜利，迁回上海。1952年，更名为上海第一医学院。1959年，被定为全国16所重点高等学府之一。1985年，更名为上海医科大学。2000年，上海医科大学和复旦大学合并办学，组建成为新的复旦大学。2012年，新的上海医学院成立，作为复旦大学党政的派出机构，根据学校的授权，在大医口的人才培养、科学研究、学科建设、发展规划、资源配置、对外交流等方面，行使相对独立的管理权限。2017年，中共复旦大学上海医学院工作委员会成立，是学校党委的派出机构。2018年12月21日，教育部、国家卫生健康委员会、上海市人民政府正式签约，共建托管复旦大学上海医学院及其直属附属医院。2019年6月14日，复旦大学上海医学院领导班子宣布会议举行。上海市委决定，建立中共复旦大学上海医学院委员会和中共复旦大学上海医学院纪律检查委员会。同日，复旦大学上海医学院高水平地方高校试点建设正式启动。</p>\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 35px; text-indent: 2em; font-size: 16px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: justify;">复旦大学上海医学院设有本科专业10个：临床医学（八年制）、临床医学（五年制）、临床医学（六年制）、口腔医学、基础医学、法医学、预防医学、公共事业管理、药学、护理学。现有博士学位授予权的一级学科9个（医学门类6个，非医学门类3个），设有博士后科研流动站8个：生物学、基础医学、临床医学、公共卫生与预防医学、中西医结合、药学、公共管理（医）、护理学。</p>\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 35px; text-indent: 2em; font-size: 16px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: justify;">复旦大学上海医学院拥有中国科学院院士10人，中国工程院院士5人，有国家级高层次人才200余人，其中国家级青年人才100余人。截至2021年底，有在校博士研究生3477人，硕士研究生3338人，普通本科生4149人，共计10964人。有专任教师716人、专职科研人员161人，其中具有高级职称576人。</p>\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 35px; text-indent: 2em; font-size: 16px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: justify;">复旦大学上海医学院设有直属院系所10个：基础医学院、临床医学院、公共卫生学院、药学院、护理学院、生物医学研究院、脑科学研究院、放射医学研究所、实验动物科学部、脑科学转化研究院。有附属医院18所（含筹）：复旦大学附属中山医院、复旦大学附属华山医院、复旦大学附属肿瘤医院、复旦大学附属妇产科医院、复旦大学附属儿科医院、复旦大学附属眼耳鼻喉科医院、复旦大学附属金山医院、复旦大学附属上海市第五人民医院、上海市（复旦大学附属）公共卫生临床中心、复旦大学附属华东医院、复旦大学附属浦东医院、复旦大学附属静安区中心医院、复旦大学附属闵行医院、复旦大学附属质子重离子医院、复旦大学附属青浦区中心医院、复旦大学附属徐汇医院、复旦大学附属精神卫生中心（筹）、复旦大学附属口腔医院（筹）。</p>\n<p style="margin: 0px 0px 10px; padding: 0px; line-height: 35px; text-indent: 2em; font-size: 16px; color: #333333; font-family: Arial, ''Microsoft YaHei'', u5b8bu4f53, Tahoma, Geneva, sans-serif; text-align: justify;">复旦大学上海医学院现有基础医学、临床医学、公共卫生与预防医学、中西医结合、药学、护理学6个一级学科，口腔医学一级学科也正在筹建中。其中基础医学、临床医学、药学、中西医结合4个学科入选为首轮国家&ldquo;双一流&rdquo;建设学科，基础医学、公共卫生与预防医学、中西医结合3个学科入选上海高峰学科建设计划。有国家老年疾病临床医学研究中心、国家放射与治疗临床医学研究中心和国家儿童医学中心（上海）、国家神经疾病医学中心、国家传染病医学中心；有国家重点实验室1个：医学神经生物学；教育部重点实验室5个：医学分子病毒学、代谢分子医学、智能化递药、公共卫生安全、癌变与侵袭原理；教育部前沿科学中心1个：脑科学；国家卫健委（卫生部）重点实验室9个：糖复合物、抗生素临床药理、手功能重建、卫生技术评估、医学分子病毒学、听觉医学、近视眼、病毒性心脏病、新生儿疾病，上海市重点实验室14个：周围神经显微外科、医学图像处理与计算机辅助技术、器官移植、女性生殖内分泌相关疾病、肾脏疾病与血液净化、视觉损害与重建、乳腺肿瘤、出生缺陷防治、老年医学临床、医学表观遗传学、肺部炎症与损伤、脑功能重塑及神经再生、传染病与生物安全应急响应、放射肿瘤学。</p>\n</div>', '', 0, 'post', 'publish', '', '', 0, '', 'open', 0, '');
